  const handleVideoSelect = (video) => {
    setCurrentVideo(video);
  }

  return (
    <div className="video-page">
      <MainVideo video={currentVideo} />
      <VideoPlaylist videos={VideoList} onVideoSelect={handleVideoSelect} />
    </div>
  );
}

export default VideoPage;
